/**
 * render function for AwNumeric
 * @deprecated afx@4.3.0
 * @alternative <AwWidget>
 * @obsoleteIn afx@6.0.0
 * @returns {JSX.Element} react component
 */
export const awNumericRenderFunction = ( props ) => {
    const {
        viewModel,
        ctxMin,
        actions,
        i18n,
        fields,
        grids,
        formProp,
        messages,
        ...prop
    } = props;
    return <AwWidget {...prop}></AwWidget>;
};
